import api from "./baseApi";

export const giftCodeApi = {
  getGiftCodes(params, cancelToken) {
    return api.get("api/gift-code", { params, cancelToken });
  },
  postGiftCode(params) {
    return api.post("api/gift-code", params);
  },
  putGiftCode(params) {
    return api.put(`api/gift-code/${params.giftCodeId}`, {
      expirationDate: params.expirationDate,
    });
  },
};
